import React from 'react';
import { makeStyles, Typography } from '@material-ui/core';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import PropTypes from 'prop-types';

const useStyles = makeStyles({
    root: {
    //   minWidth: 275,
    },
    number: {
        fontWeight: "bold"
    },
    importantCard: {
        borderLeft: "3px solid red"
    },
    importantText: {
        color: "red"
    }
  });
const ProvinceCard = props => {
    const classes = useStyles();
    const { important } = props;
    const importantCard = important ? classes.importantCard : null;
    const importantText = important ? classes.importantText : null;
    return (
        <Card className={classes.root, importantCard}>
            <CardContent>
                <Typography component="p" variant="h3" className={classes.number, importantText}>
                </Typography>
                <Typography component="p">
                </Typography>
            </CardContent>
        </Card>
    );
};

ProvinceCard.propTypes = {
    important: PropTypes.bool
};

export default ProvinceCard;
